import React from 'react';

const Products = () => {
  return (
    <div>
      <h2>Our Products</h2>
      {/* Example of products listing */}
      
      <ul>
        <li>Football T-shirt</li>
        <li>Sports Shoes</li>
        <li>Gloves</li>
      </ul>
    </div>
  );
};

export default Products;
